function getNameMeaning(name, gender) {
    var gen = seedrandom(name + gender);
    var ret = '';
    var sentences = gender.toLowerCase() === "male" ? msentences : fsentences;
    for (var i = 0; i < 5; i++) {
        ret = ret + " " + sentences[Math.floor(gen() * sentences.length)];
        gen = seedrandom(gen());
    }
    return ret;
}

function getHealthMeaning(name, gender) {
    var gen = seedrandom(name + gender);
    var ret = '';
    var sentences = gender.toLowerCase() === "male" ? mhealth : fhealth;
    for (var i = 0; i < 5; i++) {
        ret = ret + " " + sentences[Math.floor(gen() * sentences.length)];
        gen = seedrandom(gen());
    }
    return ret;
}

